class Solution {
    func maximizeTheProfit(_ n: Int, _ offers: [[Int]]) -> Int {
        var dp = Array(repeating: 0, count: n + 1)
        var offersByEnd = offers.sorted { $0[1] < $1[1] }
        var j = 0

        for i in 1...n {
            dp[i] = dp[i - 1]
            while j < offersByEnd.count && offersByEnd[j][1] < i {
                j += 1
            }
            var k = j
            while k < offersByEnd.count && offersByEnd[k][1] == i - 1 {
                dp[i] = max(dp[i], dp[offersByEnd[k][0]] + offersByEnd[k][2])
                k += 1
            }
        }

        return dp[n]
    }
}
